import React from 'react';
import './app.css';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  };

  componentDidMount() {
    this.fetchData(`https://api.spacexdata.com/v3`);
  }

  fetchData = (apiToFetch) => {
    fetch(apiToFetch)
    .then(response => response.json())
    .catch(() => {
      console.log("error")
    })
    .then((data) => {
      this.setState({
        data: data,
      });
    });
    console.log("end");
  };


  render() {
    let data = this.state.data;

    return (
      <div className="App">
        {/* <header className="App-header"> */}
          <h1>
            SpaceX
          </h1>
        {/* </header> */}

          {data.map((rocketOrDragon) => {
              return(
                <section key={rocketOrDragon.id}>
                  <p> Name </p> 
                  <p> {rocketOrDragon.name}  </p>
                  <p> Description </p>
                  <p> {rocketOrDragon.description} </p>
                  <p> Active? </p>
                  <p> {rocketOrDragon.active} </p>
                </section>
              )
            })
          }


      </div>
    );
  }

}

export default App;
